Bu bölümde Rust'ta enum cinsinden yeni bir yapı tanımlama şeklini göreceğiz. Rust'ta enum'lar farklı biçimlerde yapılar içerebilir. Örneğin bir enum içerisinde yer alan yapı: unit benzeri hiç bir eleman içermeyen, tuple cinsinden ya da C benzeri bir struct olabilir. Her bir geçerli struct yapısı, aynı zamanda geçerli bir enum biçimidir. Rust'ın yine en güçlü özelliklerinden biri olan pattern matching, enum yapısını kolay bir şekilde parçalayarak işlemeye yarar. Yazacağımız emülatörün okunabilir olabilmesi için, 16-bitlik sayı olarak okuduğumuz Opcode'u, enum ile okunabilir bir yapıya dönüştüreceğiz. Bu işlemi yapmadan önce 16-bit uzunluğunda olan ve bellekte bir adresi ifade eden Address tipimizi ve array indislerinde kolayca kullanmamızı sağlayan Register tipimizi tanımlayalım: pub type Address = u16;
pub type Register = usize; Rust'ta yeni tipler type anahtar kelimesiyle tanımlanır. Başka bir tipi daha okunabilir bir hale getirmeye yarar. Bu sayede artık adres olduğunu bildiğimiz alanlar için u16 yerine Address tipini kullanabiliriz. CHIP-8, 35 instructiona sahip bir yorumlayıcı. Bu OPCODE'ların hepsini bir enum içerisinde şu şekilde tanımlayabiliriz: pub enum Instruction { /// 0x00E0 CLS: Ekranı temizler ClearDisplay, /// 0x00EE RET: Alt programdan döner Return, /// 0x1nnn JP: `nnn` adresine zıplar Jump(Address), /// 0x2nnn CALL: `nnn` adresindeki alt programı çağırır Call(Address), /// 0x3xnn SE: Eğer `x` registeri `nn`'e eşitse bir sonraki instruction'ı atlar SkipIfEqualsByte(Register, u8), /// 0x4xnn SE: Eğer `x` registeri `nn`'e eşit değilse bir sonraki instruction'ı atlar SkipIfNotEqualsByte(Register, u8), /// 0x5xy0 SE: Eğer `x` registeri `y` registerine eşitse /// bir sonraki instruction'ı atlar SkipIfEqual(Register, Register), /// 0x6xnn LD: `x` registerinin değerini `nn` yapar. LoadByte(Register, u8), /// 0x7xnn ADD: `x` registerindeki değere `nn` ekler. AddByte(Register, u8), /// 0x8xy0 LD: `x` registerinin değerini `y` registerinin değerine eşitler. Move(Register, Register), /// 0x8xy1 OR: `x` registerinin değerini `y` registerinin değeriyle /// bitwise OR işlemi yapar. Or(Register, Register), /// 0x8xy2 AND: `x` registerinin değerini `y` registerinin değeriyle /// bitwise AND işlemi yapar. And(Register, Register), /// 0x8xy3 XOR: `x` registerinin değerini `y` registerinin değeriyle /// bitwise XOR işlemi yapar. Xor(Register, Register), /// 0x8xy4 ADD: `x` registerinin değerini `y` registerinin değeriyle toplar ve `x` /// registerinin değerini sonuca eşitler. Çıkan sonuç 8 bitten fazla ise, `F` (carry) /// registerinin değerini 1 yapar, değilse 0. Add(Register, Register), /// 0x8xy5 SUB: `x` registerinin değerini `y` registerinin değerinden çıkarır ve `x` /// registerinin değerini sonuca eşitler. Eğer `x` registerindei değer, `y` /// registerindeki değerden büyükse, `F` (carry) registerinin değerini 1 yapar, /// değilse 0. Sub(Register, Register), /// 0x8xy6 SHR: `x` registerindeki değeri bir bit sağa kaydırır. /// Eğer `x` registerinin son biti 1 ise `F` (carry) registerinin değerini 1 yapar /// değilse 0. ShiftRight(Register), /// 0x8xy7 SUB: `y` registerinin değerini `x` registerinin değerinden çıkarır ve `x` /// registerinin değerini sonuca eşitler. Eğer `x` registerindei değer, `y` /// registerindeki değerden büyükse, `F` (carry) registerinin değerini 1 yapar, /// değilse 0. ReverseSub(Register, Register), /// 0x8xyE SHR: `x` registerindeki değeri bir bit sola kaydırır. /// Eğer `x` registerinin son biti 1 ise `F` (carry) registerinin değerini 1 yapar /// değilse 0. ShiftLeft(Register), /// 0x9xy0 SE: Eğer `x` registeri `y` registerine eşit değilse /// bir sonraki instruction'ı atlar SkipIfNotEqual(Register, Register), /// 0xAnnn LD: `I` registerinin değerini `nnn` yapar. LoadI(Address), /// 0xBnnn JP: `nnn` ve `V0` registerinin toplamından çıkan sonuca zıplar. JumpPlusZero(Address), /// 0xCxnn RND: Rastgele üretilen 8 bitlik sayı `nn` ile AND işleminden sonra /// çıkan sonuç `x` registerine atanır. Random(Register, u8), /// 0xDxyn DRW: `x` ve `y` registerinden başayarak `n` adet byte sprite'ı ekranda /// gösterir. Çakışma (collision) durumu `F` registerinde tutulur. Draw(Register, Register, u8), /// 0xEx9E SKP: `x` registerinde yer alan tuş basılırsa /// bir sonraki instruction'ı atlar SkipIfPressed(Register), /// 0xExA1 SKP: `x` registerinde yer alan tuş basılı değilse /// bir sonraki instruction'ı atlar SkipIfNotPressed(Register), /// 0xFx07 LD: `x` registerinin değerini delay timer yapar. LoadDelayTimer(Register), /// 0xFx0A LD: Bir tuşa basılmasını bekler ve basılan tuşun değerini `x` /// registerine atar. Tuş basılana kadar tüm çalıştırma durur. WaitForKeyPress(Register), /// 0xFx15 LD: Delay timer'ı `x` registerindeki değer yapar. SetDelayTimer(Register), /// 0xFx18 LD: Sound timer'ı `x` registerindeki değer yapar. SetSoundTimer(Register), /// 0xFx1E ADD: `I` registerinin değerini `I` ve `x` registerinin toplamı yapar. AddToI(Register), /// 0xFx29 LD: `I` registerinin değerini `x` registerinde yer alan değerden /// gelen sprite yeri yapar. LoadSprite(Register), /// 0xFx33 LD: `x` registerinin BCD (Binary Coded Decimal) cinsinden değerini: /// `I`, `I + 1`, `I + 2` alanlarında saklar. BCDRepresentation(Register), /// 0xFx55 LD: `I` registerinde yer alan alandan itibaren /// `0` dan `x` registerine kadar olan değerleri belleğe kopyalar. StoreRegisters(Register), /// 0xFx65 LD: `I` registerinde yer alan alandan itibaren /// bellekte yer alan değerleri `0` dan `x` registerine kopyalar. LoadRegisters(Register),
} enum yapımızda içerisinde hiç bir veri tutmayan unit cinsinden ve veri barındıran tuple cinsinden bileşenleri görebilirsiniz. enum elemanları yukarıda da belirttiğimiz gibi bu iki türden de olabilir.

