Emülatörümüzün temel fonksiyonlarını tamamladıktan sonra, ekrana görüntü vereceğimiz yapımızın tanımına geçebiliriz. Öncelikle kullanacağımız yapıları modülümüze ekleyelim: use minifb::{Key, Scale, Window, WindowOptions}; minifb daha önce de bahsettiğimiz gibi en yaygın işletim sistemlerinde bir pencere açıp içerisine bir şeyler çizebileceğimiz basit bir paket. Aynı zamanda basılan tuşları da alabildiği için bizim için biçilmiş kaftan. Yapıları kullanıma aldıktan sonra bazı sabitleri tanımlayalım: const WIDTH: usize = 64;
const HEIGHT: usize = 32;
const FOREGROUND_COLOR: u32 = 0x5294e2;
const BACKGROUND_COLOR: u32 = 0x282c34; CHIP-8 64x32 piksel boyutunda bir ekrana sahip. Bu nedenle genişlik (WIDTH) ve yükseklik (HEIGHT) olarak iki sabit tanımlaması yaptık. Ayrıca arka plan rengi ve ön plan rengi olmak üzere iki 32-bit cinsinden sayı tanımladık. minifb 32-bit cinsinden olan değerleri ekrana cizebilir, isterseniz burada farklı renkler seçebilirsiniz. Rust'ta sabit tanımlamaları const anahtar kelimesiyle yapılır. Tüm sabitler 'static ömrüne sahiptir. Artık görüntü yapımızı tanımlayabiliriz: pub struct Display { buffer: [[u8; WIDTH]; HEIGHT], window: Window,
} CHIP-8 siyah beyaz bir ekrana sahip olduğundan görüntü buffer'ı 8-bitlik 64x32 boyutunda bir matris. Bu buffer içerisinde dolu pikseller için 1, boş pikseller için 0 değerini kullanacağız. window alanı için de minifb'nin Window tipini kullanıyoruz.
